import React from 'react'
import Digit from './Digit/Digit'

const CountDown = (props) => {
    return ( 
        <div className="d-flex py-5">
            <Digit color="red" value={ props.setTime.min }/>
            <Digit color="green" value={ props.setTime.sec }/>
            <Digit color="blue" value={ props.setTime.mli }/>
        </div>
    )
}
export default CountDown
